    public static String NumberToTextVN(decimal total)
    {
        try
        {
            string rs = "";
            if (total.ToString().Substring(0, 1) == "-")
            {
                //s = s.Replace("-", "").Trim();
                rs = "Trừ ";
            }

            total = Math.Round(Math.Abs(total), 0);
            string[] ch = { "không", "một", "hai", "ba", "bốn", "năm", "sáu", "bảy", "tám", "chín" };
            string[] rch = { "lẻ", "mốt", "", "", "", "lăm" };
            string[] u = { "", "mươi", "trăm", "ngàn", "", "", "triệu", "", "", "tỷ", "", "", "ngàn", "", "", "triệu" };
            string nstr = total.ToString();

            int[] n = new int[nstr.Length];
            int len = n.Length;
            for (int i = 0; i < len; i++)
            {
                n[len - 1 - i] = Convert.ToInt32(nstr.Substring(i, 1));
            }

            for (int i = len - 1; i >= 0; i--)
            {
                if (i % 3 == 2)// số 0 ở hàng trăm
                {
                    if (n[i] == 0 && n[i - 1] == 0 && n[i - 2] == 0) continue;//nếu cả 3 số là 0 thì bỏ qua không đọc
                }
                else if (i % 3 == 1) // số ở hàng chục
                {
                    if (n[i] == 0)
                    {
                        if (n[i - 1] == 0) { continue; }// nếu hàng chục và hàng đơn vị đều là 0 thì bỏ qua.
                        else
                        {
                            rs += " " + rch[n[i]]; continue;// hàng chục là 0 thì bỏ qua, đọc số hàng đơn vị
                        }
                    }
                    if (n[i] == 1)//nếu số hàng chục là 1 thì đọc là mười
                    {
                        rs += " mười"; continue;
                    }
                }
                else if (i != len - 1)// số ở hàng đơn vị (không phải là số đầu tiên)
                {
                    if (n[i] == 0)// số hàng đơn vị là 0 thì chỉ đọc đơn vị
                    {
                        if (i + 2 <= len - 1 && n[i + 2] == 0 && n[i + 1] == 0) continue;
                        rs += " " + (i % 3 == 0 ? u[i] : u[i % 3]);
                        continue;
                    }
                    if (n[i] == 1)// nếu là 1 thì tùy vào số hàng chục mà đọc: 0,1: một / còn lại: mốt
                    {
                        rs += " " + ((n[i + 1] == 1 || n[i + 1] == 0) ? ch[n[i]] : rch[n[i]]);
                        rs += " " + (i % 3 == 0 ? u[i] : u[i % 3]);
                        continue;
                    }
                    if (n[i] == 5) // cách đọc số 5
                    {
                        if (n[i + 1] != 0) //nếu số hàng chục khác 0 thì đọc số 5 là lăm
                        {
                            rs += " " + rch[n[i]];// đọc số 
                            rs += " " + (i % 3 == 0 ? u[i] : u[i % 3]);// đọc đơn vị
                            continue;
                        }
                    }
                }

                rs += (rs == "" ? " " : ", ") + ch[n[i]];// đọc số
                rs += " " + (i % 3 == 0 ? u[i] : u[i % 3]);// đọc đơn vị
            }
            if (rs[rs.Length - 1] != ' ')
                rs += " đồng";
            else
                rs += "đồng";

            if (rs.Length > 2)
            {
                string rs1 = rs.Substring(0, 2);
                rs1 = rs1.ToUpper();
                rs = rs.Substring(2);
                rs = rs1 + rs;
            }
            return rs.Trim().Replace("lẻ,", "lẻ").Replace("mươi,", "mươi").Replace("trăm,", "trăm").Replace("mười,", "mười").Replace("TRừ", "Trừ");
        }
        catch
        {
            return "";
        }

    }
    public static string Num2VNText(string s, string ccy)
    {
        //process minus case
        String minus = "";
        if (s.Substring(0, 1) == "-")
        {
            s = s.Replace("-", "").Trim();
            minus = "Trừ ";
        }

        String rtnf = "";
        int l = 0;
        int i = 0;
        int j = 0;
        int dk = 0;
        String[] A = new String[32];
        s = s.Replace(",", "");
        String s1 = "";
        String strTmp = "";
        if (s.Contains("."))
        {
            s1 = s.Substring(s.IndexOf(".") + 1);
            s = s.Substring(0, s.IndexOf("."));
        }
        String[] B = new String[8];
        s = s.Trim();
        l = s.Length;
        //l = s1.length();
        if (l > 32)
        {
            rtnf = "Number Very Large!";
            return rtnf;
        }
        for (i = 0; i < l; i++)
        {
            A[i] = s.Substring(i, 1);
        }
        for (i = 0; i < l; i++)
        {
            if (((l - i) % 3 == 0) && (A[i] == "0") && ((A[i + 1] != "0") || (A[i + 2] != "0")))
            {
                rtnf += " Không";
            }
            if (A[i] == "2") { rtnf += " Hai"; }
            else
            if (A[i] == "3") { rtnf += " Ba"; }
            else
            if (A[i] == "4") { rtnf += " Bốn"; }
            else
            if (A[i] == "6") { rtnf += " Sáu"; }
            else
            if (A[i] == "7") { rtnf += " Bảy"; }
            else
            if (A[i] == "8") { rtnf += " Tám"; }
            else
            if (A[i] == "9") { rtnf += " Chín"; }
            else
            if (A[i] == "5")
            {
                if ((i > 0) && ((l - i) % 3 == 1) && (A[i - 1] != "0"))
                {
                    rtnf += " Lăm";
                }
                else
                {
                    if (i > 0 && (l - i) % 3 == 1 && A[i - 1] != "0")
                    {
                        rtnf += " Lăm";
                    }
                    else
                    {
                        rtnf += " Năm";
                    }
                }
            }

            if ((i > 2) && (A[i] == "1") && ((l - i) % 3 == 1) && (Int32.Parse(A[i - 1]) > 1))
            {
                rtnf += " Mốt";
            }
            else if ((A[i] == "1") && (((l - i) % 3) != 2))
            {
                if ((l - i) % 3 == 1)
                {
                    if (i > 2 && A[i - 2] == "0" || i < 2 && A[0] == "1" || i > 2 && A[i - 1] == "0" || i > 2 && A[i - 1] == "0")
                    {
                        rtnf += " Một";
                    }
                    else
                    {
                        if (A[i - 1] == "1" || A[i - 1] == "0")
                        {
                            rtnf += " Một";
                        }
                        else
                        {
                            rtnf += " Mốt";
                        }

                    }
                }
                else
                {
                    rtnf += " Một";
                }
            }


            if (((l - i) % 3) == 2 && A[i] != "0" && A[i] != "1")
            {
                rtnf += " Mươi";
            }
            else if ((l - i) % 3 == 2 && A[i] != "0")
            {
                rtnf += " Mười";
            }
            if (i == 0)
            {
                if ((l - i) % 3 == 2 && A[i] == "0" && A[i + 1] != "0")
                {
                    rtnf += " Không";
                }
            }
            else
            {
                if ((l - i) % 3 == 2 && A[i] == "0" && A[i + 1] != "0")
                {
                    rtnf += " Lẻ";
                }
            }
            if ((l - i) % 3 == 0 && (A[i + 1] != "0")) //  || A[i + 2] == "0"
            {
                rtnf += " Trăm";
            }
            else if ((l - i) % 3 == 0 && A[i] != "0")
            {
                rtnf += " Trăm";
            }

            if ((l - i) == 4)
            {
                rtnf += " Nghìn";
            }
            if ((l - i) == 7)
            {
                rtnf += " Triệu";
            }
            if ((l - i) == 10)
            {
                rtnf += " Tỷ";
            }
            if ((l - i) == 13)
            {
                rtnf += " Nghìn Tỷ";
            }
            if ((l - i) == 16)
            {
                rtnf += " Triệu Tỷ";
            }
            if ((l - i) == 19)
            {
                rtnf += " Tỷ Tỷ";
            }
            if ((l - i) == 22)
            {
                rtnf += " Triệu Tỷ Tỷ";
            }
            if ((l - i) == 25)
            {
                rtnf += " Triệu Tỷ Tỷ";
            }
            if ((l - i) == 28)
            {
                rtnf += " Tỷ Tỷ Tỷ";
            }
            if ((l - i) % 3 == 0 && A[i] == "0" && A[i + 1] == "0" && A[i + 2] == "0")
            {
                i = i + 2;
            }
            if ((l - i) % 3 == 1)
            {
                dk = 1;
                for (j = i; j < l; j++)
                {
                    if (A[j] != "0")
                    {
                        dk = 0;
                    }
                }
            }
            if (dk == 1) break;

        }
        if (ccy == "USD")
        {
            rtnf += " Đô La Mỹ";
            if (s1.Length > 0) //Đọc số lẻ 
            {
                l = s1.Length;
                if (l > 8)
                {
                    rtnf += " ERROR!!!";
                    return rtnf;
                }
                for (i = 0; i < l; i++)
                {
                    B[i] = s1.Substring(i, 1);
                }
                strTmp = "";
                //Dịch Tạm
                for (i = 0; i < 2; i++)
                {
                    if ((i > 0) && (B[0] != "0") && (B[0] != "1"))
                    {
                        strTmp += " Mươi";
                    }

                    if (B[i] == "1")
                    {
                        if (i == 0)
                        {
                            strTmp += " Mười";
                        }
                        else
                        {
                            if (B[0] == "1")
                            {
                                strTmp += " Một";
                            }
                            else
                            {
                                strTmp += " Mốt";
                            }
                        }
                    }

                    switch (Int32.Parse(B[i]))
                    {

                        case 2:
                            strTmp += " Hai";
                            break;
                        case 3:
                            strTmp += " Ba";
                            break;
                        case 4:
                            strTmp += " Bốn";
                            break;
                        case 5:
                            if (i % 2 == 1 && Int32.Parse(B[0]) > 0)
                            {
                                strTmp += " Lăm";
                            }
                            else
                            {
                                strTmp += " Năm";
                            }
                            break;
                        case 6:
                            strTmp += " Sáu";
                            break;
                        case 7:
                            strTmp += " Bảy";
                            break;
                        case 8:
                            strTmp += " Tám";
                            break;
                        case 9:
                            strTmp += " Chín";
                            break;
                    }
                }
            }
            if (strTmp != "")
            {
                rtnf = rtnf + " Và" + strTmp + " Cen";
            }
        }

        if (ccy == "VND")
        {
            rtnf += " Đồng.";
        }

        rtnf = minus + rtnf; //process minus case  

        return rtnf;
    }
    public static byte[] ReadWholeArray(Stream stream)
    {
        //Source
        //http://www.yoda.arachsys.com/csharp/readbinary.html
        //Jon Skeet
        byte[] data = new byte[stream.Length];

        int offset = 0;
        int remaining = data.Length;
        while (remaining > 0)
        {
            int read = stream.Read(data, offset, remaining);
            if (read <= 0)
                throw new EndOfStreamException
                    (String.Format("End of stream reached with {0} bytes left to read", remaining));
            remaining -= read;
            offset += read;
        }

        return data;
    }
